import {useState} from 'react';
import axios from 'axios';
const Login=()=>{
    const [email,setEmail]=useState("");
    const [password,setPassword]=useState("");
    const handleForm=(event)=>{
        event.preventDefault();
        var credentials={email_ad:email,pass:password};
        axios.post("",credentials).then(function(rsp){},function(err){});
    }
    return(
        <form onSubmit={handleForm}>
            Email: <input type="text" onChange={(event)=>{setEmail(event.target.value)}} value={email}></input>
            Password: <input type="password" onChange={(event)=>{setPassword(event.target.value)}} value={password}></input>
            <input type="submit"></input>
        </form>
    )
}
export default Login;
